import React from 'react'
import './App.css'
import styled from 'styled-components'
function App() {
  return (
    <div className="App">
      <Wrapper>
        <LeftWrapper src="/assets/left_py.svg" height="400px"></LeftWrapper>
        <ContentWrapper>
          <img src="/assets/g_sortcoder.png" alt="Logo" width="150px"></img>
          <h1>Build Data Science Skills online with us.</h1>
          <Button>Get Started</Button>
        </ContentWrapper>
        <RightWrapper src="/assets/left_py.svg" height="400px"></RightWrapper>
      </Wrapper>
    </div>
  )
}

export default App
const Wrapper = styled.div`
  height: 100vh;
  background-image: linear-gradient(rgba(0, 0, 0, 0.63), rgba(0, 0, 0, 0.623)),
    url('/assets/blur.jpg');
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  display: flex;
  justify-content: space-between;
  padding: 0 40px;
  align-items: center;
`
const ContentWrapper = styled.div`
  display: flex;
  flex-direction: column;
  color: white;
  font-family: 'Noto Sans TC', sans-serif;
  align-items: center;
  padding: 0 10px;
  h1 {
    color: #fff;
    margin: 0;
    font-size: 60px;
  }
  img {
    margin: 0;
    padding-bottom: 20px;
  }
`
const LeftWrapper = styled.img`
  /* background-image: url('/assets/left_py.svg'); */
`
const RightWrapper = styled.img``

const Button = styled.div`
  padding: 12px 15px;
  background-color: #0284fe;
  border-radius: 5px;
  color: white;
  margin-top: 50px;
  cursor: pointer;
  :hover {
    box-shadow: 10px 5px 5px red;
  }
`
